import logo from './logo10.png';
import { useState } from 'react';
import './App.css';
import TopicSelector from './components/TopicSelector';
import PlotGenerator from './components/PlotGenerator';
import Chatbox from './components/chatbox';
import Calculator from './components/Calculator';
import ExamGrader from './components/ExamGrader';

import Button from './components/ui/button';
import { Card, CardHeader, CardTitle, CardContent } from './components/ui/card';
import { FaBook, FaChartLine, FaComments, FaCalculator, FaGraduationCap } from 'react-icons/fa'; // Import icons

function App() {
  const [selectedComponent, setSelectedComponent] = useState(null);

  const renderComponent = () => {
    switch (selectedComponent) {
      case 'TopicSelector':
        return <TopicSelector />;
      case 'PlotGenerator':
        return <PlotGenerator />;
      case 'Chatbox':
        return <Chatbox />;
      case 'Calculator':
        return <Calculator />;
      case 'ExamGrader':
        return <ExamGrader />;
      default:
        return (
          <Card className="text-center p-6 mx-auto border border-gray-200 shadow-lg">
            <CardHeader>
              <CardTitle className="text-gray-600 text-lg font-light">
                Click on a button to load a component
              </CardTitle>
            </CardHeader>
          </Card>
        );
    }
  };

  return (
<div className="App bg-blue-50 min-h-screen flex flex-col">
  {/* Full-width Welcome Section */}
  <header className="bg-red-900 py-12 shadow-md w-full">
    {selectedComponent === null && (
      <div className="bg-red-900 w-full text-center p-8 flex flex-col items-center lg:flex-row lg:justify-center lg:text-left">
  <div className="lg:w-1/2">
    <h1 className="text-4xl font-bold text-white">Welcome</h1>
    <p className="text-white text-lg mt-2">
      Make a choice from the options below to explore various features.
    </p>
  </div>
  <div className="lg:w-1/2 flex justify-center lg:justify-end mt-6 lg:mt-0">
    <img
      src={logo}
      className="rounded-3xl shadow-md"
      alt="logo"
      style={{ width: '450px', height: '440px' }}
    />
  </div>
</div>
    )}
  </header>

  {/* Button Section */}
  <main className="flex-grow flex flex-col items-center justify-center px-4 m-0 p-0 w-full">

    <div className="flex flex-wrap justify-center gap-4 w-full">
    <div className="space-y-6 w-full max-w-lg mx-auto text-center">
    <div className="flex flex-wrap justify-center gap-4 w-full text-center">
  <Button
    variant="default"
    className="flex flex-col items-center space-y-2 bg-white p-4 shadow-md rounded-lg w-64"
    onClick={() => setSelectedComponent('TopicSelector')}
  >
    <FaBook className="text-red-500 text-4xl" />
    <span className="text-lg font-bold">Course Helper</span>
    <p className="text-gray-500 text-sm">
      Explore resources and assistance for your courses, including guides, notes, and more.
    </p>
  </Button>

  <Button
    variant="default"
    className="flex flex-col items-center space-y-2 bg-white p-4 shadow-md rounded-lg w-64"
    onClick={() => setSelectedComponent('PlotGenerator')}
  >
    <FaChartLine className="text-red-500 text-4xl" />
    <span className="text-lg font-bold">Plot Generator</span>
    <p className="text-gray-500 text-sm">
      Generate and visualize mathematical plots and graphs interactively.
    </p>
  </Button>

  <Button
    variant="default"
    className="flex flex-col items-center space-y-2 bg-white p-4 shadow-md rounded-lg w-64"
    onClick={() => setSelectedComponent('Chatbox')}
  >
    <FaComments className="text-red-500 text-4xl" />
    <span className="text-lg font-bold">Chatbox</span>
    <p className="text-gray-500 text-sm">
      Interact with an intelligent chat assistant for help with your queries.
    </p>
  </Button>

  <Button
    variant="default"
    className="flex flex-col items-center space-y-2 bg-white p-4 shadow-md rounded-lg w-64"
    onClick={() => setSelectedComponent('Calculator')}
  >
    <FaCalculator className="text-red-500 text-4xl" />
    <span className="text-lg font-bold">Calculator</span>
    <p className="text-gray-500 text-sm">
      Perform complex calculations with an advanced scientific calculator.
    </p>
  </Button>

  <Button
    variant="default"
    className="flex flex-col items-center space-y-2 bg-white p-4 shadow-md rounded-lg w-64"
    onClick={() => setSelectedComponent('ExamGrader')}
  >
    <FaGraduationCap className="text-red-500 text-4xl" />
    <span className="text-lg font-bold">Exam Grader</span>
    <p className="text-gray-500 text-sm">
      Automatically grade exams and receive detailed feedback.
    </p>
  </Button>
</div>

</div>

    </div>

    {/* Rendered Component Section */}
    <div className="mt-12 w-full">{renderComponent()}</div>
  </main>
</div>

  );
}

export default App;
